import React from 'react'
import { List, Divider, Button } from 'antd'
import { ResultCard } from './ResultCard'
import './css/HomeMostPopular.css'
import Img from './img/breakfast.jpg'

export const HomeMostPopular = ({data, getData}) => {
    let test = [
        {id:"0001", title:"Apple Caramel encrusted banana split ice cream potato", img: Img},
        {id:"0001", title:"Apple Caramel encrusted banana split ice cream potato", img: Img},
        {id:"0001", title:"Apple Caramel encrusted banana split ice cream potato", img: Img},
        {id:"0001", title:"Apple Caramel encrusted banana split ice cream potato", img: Img},
        {id:"0001", title:"Apple Caramel encrusted banana split ice cream potato", img: Img},
        {id:"0001", title:"Apple Caramel encrusted banana split ice cream potato", img: Img},
    ]
    getData()
    return (
        <div className='home-most-popular' >
            <h1 className='title-header' style={{fontSize: 28}}>Most Popular</h1>
            <Divider/>
            <List
                grid={{
                gutter: [16, 16],
                xs: 1,
                sm: 2,
                md: 2,
                lg: 2,
                xl: 3,
                xxl: 3,
                }}
                style={{position: "relative"}}
                pagination={{defaultPageSize: 6, hideOnSinglePage: true}}
                dataSource={data}
                renderItem={item => (
                    
                <List.Item style={{height: '220px !important', position: "relative", zIndex: 1}}>
                    <ResultCard result={item}/>
                </List.Item>
                )}
            />
            <Button style={{float: 'right', marginRight: "15px"}} type="primary">See More</Button>
        </div>

    )
}
